CREATE TABLE `t_xzqh` (
  `id` bigint(20) NOT NULL COMMENT '记录编号',
  `code` int(6) NOT NULL COMMENT '行政区划代码',
  `name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '单位名称',
  `version` int(4) NOT NULL COMMENT '年份版本',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='中华人民共和国县以上行政区划代码';


ALTER TABLE `t_xzqh`
  ADD PRIMARY KEY (`id`),
  ADD UNIQUE KEY `index_code_name_version` (`code`,`name`,`version`) USING BTREE;

ALTER TABLE `t_xzqh`
  MODIFY `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '记录编号', AUTO_INCREMENT=3210;
COMMIT;
